export default function EditGenre() {
  const { id }: any = useParams();

  useEffect(() => {
      axios.get(`${urlGenres}/${id}`)
  }, []);

  return (
    <>
      <h3>Edit Genre</h3>
      <GenreForm
        model={{ name: "Action" }}
        onSubmit={async (value) => {
          // when the form is posted
          await new Promise((r) => setTimeout(r, 1));
          console.log(id);
          console.log(value);
        }}
      />
    </>
  );
}
